using System;

public class sudoku
{


static bool eof;
static String buffer;
public static char readChar_(){
  if (buffer == null){
    buffer = Console.ReadLine();
  }
  if (buffer.Length == 0){
    String tmp = Console.ReadLine();
    eof = tmp == null;
    buffer = "\n"+tmp;
  }
  char c = buffer[0];
  return c;
}
public static void consommeChar(){
       readChar_();
  buffer = buffer.Substring(1);
}
public static char readChar(){
  char out_ = readChar_();
  consommeChar();
  return out_;
}

public static void stdin_sep(){
  do{
    if (eof) return;
    char c = readChar_();
    if (c == ' ' || c == '\n' || c == '\t' || c == '\r'){
      consommeChar();
    }else{
      return;
    }
  } while(true);
}

public static int readInt(){
  int i = 0;
  char s = readChar_();
  int sign = 1;
  if (s == '-'){
    sign = -1;
    consommeChar();
  }
  do{
    char c = readChar_();
    if (c <= '9' && c >= '0'){
      i = i * 10 + c - '0';
      consommeChar();
    }else{
      return i * sign;
    }
  } while(true);
}



  public static int[] read_sudoku()
  {
    int h = 9 * 9;
    int[] out_ = new int[h];
    for (int i = 0 ; i < h; i++)
    {
      int k = 0;
      k = readInt();
      stdin_sep();
      out_[i] = k;
    }
    return out_;
  }
  
  public static void print_sudoku(int[] sudoku_)
  {
    for (int y = 0 ; y <= 8; y ++)
    {
      for (int x = 0 ; x <= 8; x ++)
      {
        int j = sudoku_[x + y * 9];
        Console.Write(j);
        Console.Write(" ");
        if ((x % 3) == 2)
        {
          Console.Write(" ");
        }
      }
      Console.Write("\n");
      if ((y % 3) == 2)
      {
        Console.Write("\n");
      }
    }
    Console.Write("\n");
  }
  
  public static bool sudoku_done(int[] s)
  {
    for (int i = 0 ; i <= 80; i ++)
    {
      if (s[i] == 0)
      {
        return false;
      }
    }
    return true;
  }
  
